import React from 'react';
import {BrowserRouter} from 'react-router-dom';
class FormRouting extends Component {
    render() {
        return (
            <BrowserRouter>
                <header>
                    <div>
                        <h4>Hello Form Using Router</h4>
                    </div>
                </header>
            </BrowserRouter>
        )
    }
}
export default FormRouting;
